async function yjsSync(
  spaceTitle,
  yjsServer = "localhost:1234",
  yjsProtocol = "ws"
) {
  let title;

  if (!spaceTitle) {
    if (window.caeRoom) {
      title = window.caeRoom;
    } else if (localStorage.getItem("syncmetaSpace")) {
      title = localStorage.getItem("syncmetaSpace");
    } else {
      title = Util.getSpaceTitle(location.href);
    }
  }

  if (window.y && title === spaceTitle) {
    // yjs is already initialized and we are using the same spaceTitle
    return new Promise((resolve) => resolve(window.y));
  }

  const doc = new Doc();

  // Sync clients with the y-websocket provider
  const websocketProvider = new WebsocketProvider(
    `${yjsProtocol}://${yjsServer}`,
    title,
    doc
  );

  await new Promise((resolve, reject) => {
    websocketProvider.on("status", (event) => {
      // console.log(event.status); // logs "connected" or "disconnected"

      if (event.status == "connected") {
        if (!window.y) {
          window.y = doc;
        }
        resolve(title);
      }
    });
    setTimeout(() => {
      reject("YJS connection timed out. This means syncmeta widgets wont work");
    }, 5000);
  });
  if (window.y) {
    // it could be that another yjsSync call was made before this one resolved
    return window.y;
  }
  return doc;
}

async function getUserInfo() {
  const url =
    localStorage.getItem("userinfo_endpoint") ||
    "https://auth.las2peer.org/auth/realms/main/protocol/openid-connect/userinfo";
  const response = await fetch(url, {
    headers: { Authorization: "Bearer " + localStorage.access_token },
  }).catch((error) => {
    console.warn("Error while fetching profile information : " + error);
  });

  try {
    if (response && response.ok) {
      const data = await response.json();
      const space = { user: {} };
      space.user[CONFIG.NS.PERSON.TITLE] = data.preferred_username;
      space.user[CONFIG.NS.PERSON.JABBERID] = data.sub;
      space.user[CONFIG.NS.PERSON.MBOX] = data.email;
      space.user.globalId = -1;
      space.user.self = true;

      return space;
    }
  } catch (error) {
    console.error(error);
  }

  return { user: Util.generateAnonymousUser() };
}

